######################################################################
#   
#   Name:           DEFAULTS.ini
#   
#   Description:    Default parameters/parameter values for Ensembl ini files
#                   Parameters defined here are copied into the SpeciesDefs
#                   configuration data structure in locations corresponding 
#                   to _empty_ sections of each <species>.ini file.
#
######################################################################

######################################################################
# 'GENERAL' SETTINGS
# - Default database connection settings,
# - Filesystem paths to utilities used by the web site code,
# - Connection info for inbound/outbound web services,
# - Parameters that control the look-and-feel of the site.
#

[general]
ENSEMBL_SITE_NAME = Ensembl Genomes
ENSEMBL_CHROMOSOMES = []
DISPLAY_ONTOLOGIES = [ GO ]
ONTOLOGY_SUBSETS = [ goslim_generic ]
MAPPED_ONTOLOGIES = [GO]
COMPARA_HIGHLIGHTS = [GO INTERPRO]
USERDATA_REMOTE_FORMATS = [BAM BigWig VCF]
ALLOW_FTP_BAM    = 1
ALLOW_FTP_BIGWIG = 1
ALLOW_FTP_VCF    = 1
TRACK_COLOUR_ARRAY = [darkgrey darkgreen darkblue darkred black brown grey orange purple green blue red]

ENSEMBL_SEARCH = Search/Results
ENSEMBL_TEXT_INDEXER = EBeye

SITE_ICON        = ensembl-favicon.png
ENSEMBL_DEFAULT_SEARCHCODE    = ensemblunit
TEMPLATE_ROOT = /eg-plugins/common/templates
EBEYE_ENDPOINT = http://www.ebi.ac.uk/ebisearch/service.ebi
S4DAS_EBEYE_ENDPOINT = http://www.ebi.ac.uk/ebisearch/service.ebi

; don't inherit the Ensembl ENSEMBL_GENOMES setting or we may get a 
; self-referential link in the external browsers menu
ENSEMBL_GENOMES = 

####
ENSEMBL_CALC_GENOTYPES_FILE   =  /nfs/public/rw/ensembl/tools/calc_genotypes

ENSEMBL_BLAST_BIN_PATH = /dummy/path
ENSEMBL_BLAST_FILTER   = /dummy/path
ENSEMBL_BLAST_MATRIX   = /dummy/path

# Default database is the EBI public
DATABASE_HOST       = mysql.ebi.ac.uk
DATABASE_HOST_PORT  = 4157
DATABASE_DBUSER     = anonymous
DATABASE_DBPASS     =
DATABASE_WRITE_USER = ensrw
DATABASE_WRITE_PASS = ensrw

EBEYE_ENDPOINT = http://www.ebi.ac.uk/ebisearch/service.ebi

ENSEMBL_PFETCH_SERVER = example.com
ENSEMBL_PFETCH_PORT   = 10000
ENSEMBL_WISE2_PATH    = /nfs/public/rw/ensembl/tools/wise2_with_fix
ENSEMBL_EMBOSS_PATH   = /nfs/public/rw/ensembl/tools/emboss

ENSEMBL_BLAST_BIN_PATH = /ebi/extserv/bin/wu-blast
ENSEMBL_BLAST_FILTER   = /ebi/extserv/bin/wu-blast/filter
ENSEMBL_BLAST_MATRIX   = /ebi/extserv/bin/wu-blast/matrix

[DATABASE_USERDATA]
HOST = localhost
PORT = 3306
USER = ensrw
PASS = ensrw

[ENSEMBL_EXTERNAL_INDEXERS]
; this  just need to point somewhere
PFETCH  = /dummy/path
EGFETCH = /dummy/path

[ENSEMBL_STYLE]
GRAPHIC_TTF_PATH = /nfs/public/rw/ensembl/fonts/truetype/msttcorefonts/
