url         = http://www.ebi.ac.uk/das-srv/s4/das
dsn         = protein-proxy
on          = [ geneview ]
renderer    = S4DASUniprot
coords      = [ uniprot_peptide ]

[S4_PROTEIN_STRUCTURE]
