label       = Protein structure
homepage    = http://www.ebi.ac.uk/das-srv/proteindas
url         = http://www.ebi.ac.uk/das-srv/proteindas/das
dsn         = pdbe_summary
on          = [ geneview ]
renderer    = S4DASUniprot
coords      = [ uniprot_peptide ]


